// frontend/src/TrainMap.js

const TrainMap = () => {
  return (
    <svg 
      width="100%" 
      height="250" 
      viewBox="0 0 1400 250" 
      xmlns="http://www.w3.org/2000/svg"
      style={{ backgroundColor: '#f8f9fa', border: '1px solid #dee2e6', borderRadius: '8px' }}
    >
      <title>Upgraded Railway Route</title>
      
      {/* Main Track Line */}
      <line id="main-track" x1="210" y1="151" x2="1370" y2="151" stroke="#333" strokeWidth="4" />

      {/* NEW: Loop Track at Kalyan */}
      <path
        id="loop-track-kalyan"
        d="M 630 151 C 645 151, 650 121, 665 121 L 765 121 C 780 121, 785 151, 800 151"
        stroke="#888" strokeWidth="3" fill="none" strokeDasharray="5,5"
      />

      {/* NEW: Loop Track at Lonavala */}
      <path
        id="loop-track-lonavala"
        d="M 1000 151 C 1015 151, 1020 121, 1035 121 L 1135 121 C 1150 121, 1155 151, 1170 151"
        stroke="#888" strokeWidth="3" fill="none" strokeDasharray="5,5"
      />

      {/* Stations */}
      {[
        { x: 210, name: "MUMBAI CST" }, { x: 450, name: "THANE" },
        { x: 700, name: "KALYAN" }, { x: 890, name: "KARJAT" },
        { x: 1070, name: "LONAVALA" }, { x: 1310, name: "PUNE" }
      ].map(station => (
        <g key={station.name}>
          <ellipse cx={station.x} cy="151" rx="10" ry="10" fill="#1f77b4" stroke="#ffffff" strokeWidth="2" />
          <text x={station.x} y="185" fontFamily="Helvetica" fontSize="12px" fontWeight="bold" textAnchor="middle">{station.name}</text>
        </g>
      ))}
    </svg>
  );
};

export default TrainMap;
